import React, { useEffect, useState } from "react";
import "../Css/NavPanel.css";

const NavPanel = () => {
  return (
    <div className="nav-section">
      <div className="nav-option">Add GSM</div>
      <div className="nav-option">Add Shade</div>
      <div className="nav-option">No of High Defects</div>
      <div className="nav-option">Pass Fail Status</div>
      <div className="nav-option">Batch Status</div>
      <div className="nav-option">Report</div>
    </div>
  );
};

export default NavPanel;
